var $bm_rt;
var d, calibrate, on_off, veloc, r, r;
d = effect('Rotation - Spin Direction')('ADBE Checkbox Control-0001');
calibrate = effect('Rotation - Spin Calibrate')('ADBE Slider Control-0001');
$bm_rt = on_off = effect('Rotation - Spin On/Off')('ADBE Checkbox Control-0001');
if (on_off == 1) {
    $bm_rt = veloc = effect('Rotation - Spins /sec')('ADBE Angle Control-0001');
    if (d == 1) {
        $bm_rt = r = $bm_sum($bm_sum($bm_transform.rotation, $bm_mul($bm_sub(time, inPoint), veloc)), calibrate);
    } else {
        $bm_rt = r = $bm_mul($bm_sum($bm_sum($bm_transform.rotation, $bm_mul($bm_sub(time, inPoint), veloc)), calibrate), -1);
    }
}

